    const {name, type, status, dimension} = props;

    return (
        <Card className='location-card'>
        <Card.Content>
          <Card.Header>{name}</Card.Header>
          {/* <Card.Meta>{type} {status}</Card.Meta> */}
          <Card.Description> {type} {status} {dimension} </Card.Description>
        </Card.Content>

  </Card>

  )
}
